import React, {Component} from 'react'
import { Spin, Space } from 'antd'
import { LoadingOutlined } from '@ant-design/icons';
/*
头部组件
 */
export default class Loading extends Component{
    render(){
        return(
            <Space size='middle'>
                <LoadingOutlined style={{ fontSize: 24 }} spin />
            </Space>
        )
    }
}
